import React, {useEffect, useState} from 'react'
import {useParams, useNavigate} from 'react-router-dom';
import axios from 'axios';
import {Formik, Form, Field, ErrorMessage} from 'formik';
import * as Yup from 'yup';

function UpdateDobavljac() {
    let {id} = useParams();
    const [dobavljacObject, setDobavljacObject] = useState({});
    let navigate = useNavigate();

    useEffect(() => {
        if (!localStorage.getItem("accessToken")) {
          navigate("/login");}
          else{
          axios.get(`http://localhost:3001/dobavljaci/byId/${id}`).then( (response) =>{
            setDobavljacObject(response.data);
          });
        };
      }, []);

      const [nazivObj, setNazivObj] = useState(dobavljacObject.naziv);

      const initialValues = {
        naziv: "",
        iib: "",
        pdv: "",
        kontakt_osoba: "",
        email_adresa: "",
        datum_pocetka: "",
        datum_zavrsetka: "",
      };

      const validationSchema = Yup.object().shape({
        naziv: Yup.string().required("Moras unijeti naziv!"),
        iib: Yup.string().required(),
        pdv: Yup.number().required(),
      });

      function handleChange(event) {
        event.preventDefault();
        setNazivObj(event.target.value);
      }
    
      const onSubmit = (data) => {
        axios.put(
            "http://localhost:3001/dobavljaci",
            {
              id: id,
              naziv: data.naziv,
              iib: data.iib,
              pdv: data.pdv,
              broj_telefona: data.broj_telefona,
              kontakt_osoba: data.kontakt_osoba,
              email_adresa: data.email_adresa,
              datum_pocetka: data.datum_pocetka,
              datum_zavrsetka: data.datum_zavrsetka
            }
          );
          navigate("/");
      };

  return (
    <div>
      <Formik
      initialValues={initialValues}
      onSubmit={onSubmit}
      validationSchema={validationSchema}
      >
        <Form className="formContainer">
          <label>Naziv: </label>
          <ErrorMessage name="naziv" component="span" />
          <Field
            id="inputCreatePost"
            name="naziv"
            placeholder="naziv"
            value = {nazivObj}
            onChange={handleChange}

          />
          <label>IIB: </label>
          <ErrorMessage name="iib" component="span" />
          <Field
            id="inputCreatePost"
            name="iib"
            placeholder="iib"
          />
          <label>PDV: </label>
          <ErrorMessage name="pdv" component="span" />
          <Field
            id="inputCreatePost"
            type = "number"
            name="pdv"
            placeholder="10"
            value = {dobavljacObject.pdv}
          />
        <label>Broj telefona: </label>
          <ErrorMessage name="broj_telefona" component="span" />
          <Field
            id="inputCreatePost"
            name="broj_telefona"
            placeholder="065749206"
            value = {dobavljacObject.broj_telefona}
          />
        <label>Kontakt osoba: </label>
          <ErrorMessage name="kontakt_osoba" component="span" />
          <Field
            id="inputCreatePost"
            name="kontakt_osoba"
            placeholder="062375839"
            value = {dobavljacObject.kontakt_osoba}
          />
        <label>Email: </label>
          <ErrorMessage name="email_adresa" component="span" />
          <Field
            id="inputCreatePost"
            name="email_adresa"
            placeholder="@"
            value = {dobavljacObject.email_adresa}
          />
        <label>Datum pocetka: </label>
          <ErrorMessage name="datum_pocetka" component="span" />
          <Field
            id="inputCreatePost"
            name="datum_pocetka"
            type="date"
            value = {dobavljacObject.datum_pocetka}
          />
        <label>Datum zavrsetka: </label>
          <ErrorMessage name="datum_zavrsetka" component="span" />
          <Field
            id="inputCreatePost"
            name="datum_zavrsetka"
            type="date"
            value = {dobavljacObject.datum_zavrsetka}
          />
          <button type="submit"> Uredi dobavljaca</button>
        </Form>
      </Formik>
    </div>
  )
}

export default UpdateDobavljac
